import LbBlock from "./components/LbBlock";
import PBlock from "./components/PBlock";


let hakkimdaParagraph =
  "Çalışmaya hevesli, bildiğini uygulamayı çok seven; bilmediğini ise öğrenmek için can atan bir karaktere sahibim. Çevremdeki insanlarla uyum içerisinde ilerleyebilen; durum karışıklıklarında ise ortak bir çözüm yolu bulmaya çalışırım. Çalıştığı iş yerinde maksimum verimi almak isterim ve bunun için büyük çaba sarf ederim.";
let hobbieParagraf =
  "Hobilerim:\n futbol,voleybol oynamaktan; koşu yapmaktan, arkadaşlar ile aktivite, bilgisayar oyunları be bilgisayar donanımları ile ilgilenmekten en sevdiğim hobilerim";

const valueList = [
  {
    id: "hakkimda",
    text: hakkimdaParagraph,
    title: "Hakkımda",
    hobbie: hobbieParagraf,
  },
  {
    id: "hobbie-list",
    e1: "Futbol oynamak",
    e2: "Voleybol oynamak",
    e3: "Koşu yapmak",
    e4: "Bilgisayar donanımları ile ilgilenmek",
  },
  {
    id: "egitim",
    title: "Eğitim",
    o1: "Trakya Üniversitesi Bilgisayar Mühendisliği (2019-)",
    o1n: "Not Ortalaması 3.43 (4 üzerinden)",
    o2: "Hamdi Bozbağ Anadolu Lisesi (2014-2018)",
    o3: "Aksu Seka İlköğretim Okulu (2006-2014)",
  },
];
function App() {
  return (
    <div>
      <PBlock values={valueList} />
      <LbBlock values={valueList} />
    </div>
  );
}

export default App;
